import React, { useState } from "react";


const Contanct =()=>{
  const [ data ,setData ] = useState({
    name:"",
    number:"",
    email:"",
    about:""
  });

  const inputButton=(event)=>{
    console.log(event.target.value);
    // const [name , value] =event.target.value;

    // setData(prevData)=>{
    //     return (...prevData)
    // }


  }

    return(
        <>
          <div className="my-5">
             <h1 className="text-center">Contanct Us </h1>
          </div>
          <div className="container contact_div">
             <div className="row">
                    <div className="col-md-6 col-10 mx-auto">
                        <div className="mb-2">
                            <label for="exampleFormControlInput1" className="form-label">Full Name</label>
                            <input type="text" className="form-control" name="name" value={data.name} id="exampleFormControlInput1 " placeholder="Enter Your Full Name"/>
                        </div>
                        <div className="mb-2">
                            <label for="exampleFormControlInput1" className="form-label">Mobile number</label>
                            <input type="number" className="form-control" name="number" value={data.number} id="exampleFormControlInput1 " placeholder="Enter your Mobile Number"/>
                        </div>
                        <div className="mb-2">
                            <label for="exampleFormControlInput1" className="form-label">Email address</label>
                            <input type="email" className="form-control" name="email" value={data.email} id="exampleFormControlInput1 " placeholder="name@example.com"/>
                        </div>
                        <div className="mb-3">
                            <label for="exampleFormControlTextarea1" className="form-label">About Your</label>
                            <textarea className="form-control" name="about" value={data.about} placeholder="Enter your about" id="exampleFormControlTextarea1" rows="2"></textarea>
                        </div>
                        <div className="col-12" onClick={inputButton}>
                            <button className="btn btn-outline-primary " type="submit">Submit form</button>
                        </div>
                    </div>
                </div>
          </div>
        </>
    )
}


export default Contanct;
